export const palette = {
    black: '#000000',
    xiketic: '#11030C',
    xiketic2: '#1D0916',
    darkPurple: '#301025',
    frostbite: '#DC35A1',
    lavenderBlush: '#FCEEF7',
    lavenderBlush04: 'rgba(252, 238, 247, 0.04)',
}

export const background = {
    backgroundColor: palette.xiketic,
}

export const primaryButton = {
    backgroundColor: palette.frostbite,
}
